                    </div>
                    <p>Seyi Martinz</p>
                    <span style={{marginTop: 8, marginLeft: 7}}>
          < ArrowDropDownIcon/>
          <Menu
        id="demo-positioned-menu"
        aria-labelledby="demo-positioned-button"
        anchorOrigin={{
          vertical: 'top',
          horizontal: 'left',
        }}
        transformOrigin={{
          vertical: 'top',
          horizontal: 'left',
        }}
      >
        <MenuItem>Create User Name</MenuItem>
      </Menu>
        </span>
                </span>
        </div>
        </div>
    )
}


export default Header
